script: |
  super -f text -I q902.spq | sort > q902.out

inputs:
  - name: q902.spq
    data: |
      SELECT + + col0 / + + 88 * + col0 + ( - col0 ), + 69 * - 69 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN - 5 AND col0 + 70 * col2 * - col2 + - col1 - col1 + + 42 * - col0 * + col1 * 33;
  - name: tab1

outputs:
  - name: q902.out
    data: |
